import React from "react"
import NavigationButton from "./NavigationButton"

class Navigation extends React.Component {

  handleChange(value) {
    this.props.changePageValue(value)
  }

  render() {
    return (
    <nav className="navigation-container" onClick={handleChange(1)}>
      <NavigationButton key={0} page={0} />
      <NavigationButton key={1} page={1} />
      <NavigationButton key={2} page={2} />
      <NavigationButton key={3} page={3} />
    </nav>
    )
  }
}

export default Navigation
